/*Table structure for table `task_list` */

DROP TABLE IF EXISTS `task_list`;

CREATE TABLE `task_list` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `cid` int(10) NOT NULL COMMENT '任务对应用户ID',
  `type` char(50) NOT NULL COMMENT '任务类型',
  `opt` char(50) NOT NULL,
  `timeout` int(11) NOT NULL COMMENT '任务超时时间',
  `retry` int(11) NOT NULL COMMENT '任务重试次数',
  `data` varchar(1024) NOT NULL COMMENT '任务内容',
  `status` char(50) NOT NULL COMMENT '任务状态',
  `starttime` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '任务时间戳',
  `finishtime` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=347 DEFAULT CHARSET=utf8;

